import Post from "../post/Post"
import Share from "../share/Share"
import "./feed.css"
import axios from "axios" ;

const Feed = () => {
  const [posts , setPosts] = useState([]) ;
  
  useEffect(() => {
    const res = axios.get("posts/timeline/64940042903e53381b15d788")
    console.log(res);
  } , [])
  return (
    <div className="feed">
      <div className="feedWrapper">
        <Share/>
        {/* {Posts.map(p => (
          <Post key={p.id} post = {p}/>
        ))} */}
      </div>
    </div>
  )
}

export default Feed
